import { GET_DETAIL, GET_DOGS } from "./types";

const initialState = { dogs: [], filter: [] };

const rootReducer = (state = initialState, action) => {
  switch (action.type) {
    case GET_DOGS:
      return { ...state.dogs, dogs: action.payload };
    case GET_DETAIL:
      return { ...state.dogs, dogs: action.payload };
    default:
      return { ...state.dogs };
  }
};

export default rootReducer;
